import React from "react";
import stlFooter from "./Footer.module.css";
import logoWebVidal from "../../images/WebVidal.svg";
import whatsapp from "../../images/whatsapp.png";
import linkedin from "../../images/linkedin.png";
import telefono from "../../images/telefono.png";
import github from "../../images/github.svg"

const Footer = () => {
  return (
    <div className={stlFooter.footerCont}>

      <div className={stlFooter.logoWV}>
        <img src={logoWebVidal} alt="" />
      </div>

      <div className={stlFooter.copyright}>
        <h3>Copyright Â© 2023 WEB VIDAL</h3>
      </div>

      <div className={stlFooter.contact}>
        <img href="https://wa.me/573154629071?text=Cordial%20saludo,%20lo%20estamos contactando%20porque%20vimos%20la%20pagina%20web%20de%20su%20Hoja%20de%20vida" src={whatsapp} alt="" />
        <img href="https://github.com/VVIDALSI" src={github} alt="" />
        <img href="https://www.linkedin.com/in/victor-alejandro-vidal-silva-85b373192/" src={linkedin} alt="" />
        <img href="tel:+573154629071" src={telefono} alt="" />
      </div>
    </div>
  );
};

export default Footer;
